import React, { useEffect, useState } from "react";
import axios from "axios";

export default function TransactionList() {
  
    const [transactionList, setTransactionList] = useState([])

    useEffect(() => {
        axios.get("http://localhost:3001/transaction/list", {
            headers: {
                token: localStorage.getItem("token")
            }
        })
        .then((response) =>{
            setTransactionList(response.data)
        })
    }, [])

  return (
    <div class="container-sm">
    <div className="transaction--list" class="card-group">
      {transactionList.map((value, key) => {
        return (
          <div class="row row-cols-1 row-cols-md-3 g-4">
            <div class="col">
          <div class="card">
            <div class="card-body">
              <h2 class="card-title">{value.concept} </h2>
              <h6 className="date">{value.date}</h6>
              <h6 className="type">Your {value.type} was: ${value.amount}</h6>
              <p class="card-text">{value.comment}</p>
            </div>
            </div>
            </div>

          </div>
        );
      })}
    </div>
    </div>
  );
}
